import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <ul>
          <li><button>Home</button></li>
          <li><button>Movies</button></li>
          <li><button>TV Series</button></li>
          <li><button>Channels</button></li>
        </ul>
      </header>
    </div>
  );
}

export default App;
